import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPhone, faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { useState } from "react";

function Contact() {
  const [isPhoneClicked, setIsPhoneClicked] = useState(false);
  const [isEmailClicked, setIsEmailClicked] = useState(false);
  const icons = [faPhone, faEnvelope];

  return (
    <div className="bg-lightTone">
      <div className="max-w-screen-lg mx-auto flex flex-col items-center py-padY">
        <div className="font-racing text-5xl p-10 text-darkTone">
          Get in Touch
        </div>
        <div className="pb-10">
          <div className="flex flex-row px-10 pb-10 gap-10 ">
            {icons.map((item, index) => (
              <div
                className="border-4 border-darkTone rounded-xl hover:bg-darkTone text-darkTone hover:text-white p-6"
                key={index}
              >
                <FontAwesomeIcon className=" " icon={item} size="2x" />
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Contact;
